  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text(
          'Monthly Invoice',
        ),
        actions: [
          InkWell(
            onTap: () {
              final provider = context.read<TransactionProviderImpl>();
              Share.shareFiles([provider.pdfFile?.path ?? ''], text: 'Invoice');
            },
            child: Padding(
              padding: EdgeInsets.only(
                right: kFlexibleSize(30),
              ),
              child: Container(
                width: kFlexibleSize(30),
                height: kFlexibleSize(30),
                child: downloadImage,
              ),
            ),
          )
        ],
      ),
      body: _body(context),
    );
  }

  Widget _body(BuildContext context) {
    final provider = context.watch<TransactionProviderImpl>();

    final hasError = provider.getInvoiceRes?.state == Status.ERROR ||
        provider.getInvoiceRes?.state == Status.UNAUTHORISED;

    if (hasError) {
      return Center(
          child: NoDataFoundView(
              retryCall: () {
                context
                    .read<TransactionProviderImpl>()
                    .GetInvoice(invoiceId: widget.invoiceId ?? '');
              },
              title: 'No Data Found'));
    }

    final isLoading = provider.getInvoiceRes?.state == Status.LOADING;

    final path = provider.pdfFile;

    if (isLoading) {
      return Center(child: LoadingSmall());
    }

    if (path != null) {
      return PDFView(
        filePath: path.path,
      );
    } else {
      return Container();
    }
  }
}
